css:
:root {
  font-size: 16px;
}
.filter-selector {
  padding-right: 5px;
}
.filter-selector .filter-label {
  padding-right: 5px;
  vertical-align: middle;
  line-height: 1.8em;
}
.filter-selector .filter-button {
  border-radius: 0;
  height: initial;
  background: #43484d;
  text-shadow: none;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-left: 0;
  padding-top: initial;
  line-height: 1.8em;
}
.filter-selector .filter-button:first-child {
  border-left: 1px solid #181818;
  border-top-left-radius: 0.125rem;
  border-bottom-left-radius: 0.125rem;
}
.filter-selector .filter-button:last-child {
  border-top-right-radius: 0.125rem;
  border-bottom-right-radius: 0.125rem;
}
.filter-selector .filter-button:hover .delete-button {
  visibility: visible;
}
.filter-selector .filter-button.selected {
  background-color: #5c6064;
  color: rgba(131, 148, 150, 0.6);
}
